import React, { Component } from 'react';



class WeekWeather extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="weeks-weather">
                <h2>This Week's Weather</h2>
                     {this.props.weather.map((item,i) =>
                     <ul>
                        <li>Date: {item[0]} </li>
                        <li>{item[2]}</li>
                        <li>Icon: <img src={`http://openweathermap.org/img/w/${item[1]}.png`}/></li>
                        <li>High: {item[3]}&#176; </li>
                        <li>Low: {item[4]}&#176;</li>
                        <br></br>
                        </ul>
                        )} 
            </div>
         );
    }
}

export default WeekWeather;
